import React from "react";


const User = ({ usuario }) => (

<div className="repoListContainer">
   <div>
   Avatar:<img src="{{usuario.avatar_url}}"/>
   </div>
   <p></p>
  <lu>
   <li>followers:{usuario.followers}</li>
   <li>following:{usuario.following}</li>
   <li>email:{usuario.email}</li>
   <li>bio:{usuario.bio}</li>
   </lu>
  
</div>


);




export default User;
